def generate_fibonacci_series(num):
    (a, b) = (0, 1)
    fib_series = []
    if num < 0:
        return fib_series
    if num == 1:
        fib_series.append(0)
        return fib_series
    if num == 2:
        fib_series.extend([0, 1])
        return fib_series
    fib_series.extend([0, 1])
    for i in range(2, num):
        next_num = a + b
        (a, b) = (b, next_num)
        fib_series.append(next_num)
        if next_num % 2 == 0:
            fib_series.append(next_num * 2)
        if next_num % 3 == 0:
            fib_series.append(next_num // 3)
        if next_num % 5 == 0:
            fib_series.append(next_num - 5)
    return fib_series

